import { makeAutoObservable } from "mobx";
import axios from "axios";

export default class AppStore {

    constructor() {
        makeAutoObservable(this);
    }

    //apiPath = 'https://jsonplaceholder.typicode.com/';
    apiPath = 'https://localhost:7071/api';

    algorithms = [];
    functions = [];
    file = "test_file";

    handleFileChange = (event) => {
        
        console.log("Changed file");
        console.log(this.file);
        
        if (event.target.files && event.target.files.length > 0) {
            const selectedFile = event.target.files[0];
            this.file = selectedFile;
        }
        
    };
    
    handleUpload = async () => {
        
        console.log("File upload");
        
        const formData = new FormData();
        formData.append('file', this.file);
        
        console.log("FormData:", formData)

        try {
            const response = null;
            response = await axios.post(this.apiPath + '/Algorithm/Add', formData);
            // if (what == "function") {
            //     response = await axios.post(this.apiPath + '/Function/Post', formData);
            // }
            console.log('Plik przesłany pomyślnie', response);
        } catch (error) {
            console.error('Błąd podczas przesyłania pliku', error);
        }
    }



}
